import React, { useState, useEffect } from "react";
import { useDrop } from "react-dnd";

function Team({ team: team }) {
  const [drop] = useDrop(() => ({
    accept: "employee",
  }));
  return (
    <div className="team" key={team.id} ref={drop}>
      <div> {team.Name} </div>
    </div>
  );
}

export default Team;
